i:4;s:22:\"zerif_clients-widget-5\";}s:20:\"zerif-sidebar-footer\";a:0:{}s:22:\"zerif-sidebar-footer-2\";a:0:{}s:22:\"zerif-sidebar-footer-3\";a:0:{}s:16:\"sidebar-ourfocus\";a:2:{i:0;s:17:\"ctup-ads-widget-6\";i:1;s:17:\"ctup-ads-widget-7\";}s:20:\"sidebar-testimonials\";a:3:{i:0;s:21:\"zerif_testim-widget-1\";i:1;s:21:\"zerif_testim-widget-2\";i:2;s:21:\"zerif_testim-widget-3\";}s:15:\"sidebar-ourteam\";a:4:{i:0;s:19:\"zerif_team-widget-1\";i:1;s:19:\"zerif_team-widget-2\";i:2;s:19:\"zerif_team-widget-3\";i:3;s:19:\"zerif_team-widget-4\";}}}s:19:\"zerif_ourteam_title\";s:18:\"Lugares de entrega\";s:22:\"zerif_ourteam_subtitle\";s:0:\"\";s:19:\"zerif_parallax_show\";b:1;s:18:\"zerif_aboutus_show\";b:0;s:19:\"zerif_parallax_img1\";s:129:\"http://localhost:8080/wzstore/wp-content/uploads/2022/11/shop-for-clothing-clothes-shop-on-hanger-at-the-modern-shop-boutique.jpg\";s:19:\"zerif_parallax_img2\";s:77:\"http://wazisocks.com:8080/wzstore/wp-content/uploads/2019/11/calcetinesx2.png\";s:22:\"zerif_aboutus_subtitle\";s:7:\"ELYSIUM\";s:26:\"zerif_aboutus_biglefttitle\";s:0:\"\";s:18:\"zerif_aboutus_text\";s:328:\"Tenemos como objetivo la comercialización de prendas de vestir para hombre y para dama, así como venta de calzado que resalten la belleza de nuestros clientes, todos nuestros productos están regidos por las últimas tendencias de la moda para cada temporada (primavera-verano y otoño-invierno) en ropa, calzado y accesorios.\";s:28:\"zerif_aboutus_feature1_title\";s:17:\"Feedback continuo\";s:25:\"zerif_aboutus_feature1_nr\";i:100;s:27:\"zerif_aboutus_feature1_text\";s:153:\"Creemos que la mejor forma de seguir avanzando en nuestro proyecto es escuchar a aquellos que son más importantes para nosotros, nuestros consumidores. \";s:28:\"zerif_aboutus_feature2_title\";s:15:\"Responsabilidad\";s:27:\"zerif_aboutus_feature2_text\";s:114:\"Con nuestros clientes, haciendo un esfuerzo continuo para llevar las últimas innovaciones a nuestras colecciones.\";s:25:\"zerif_aboutus_feature2_nr\";i:100;s:28:\"zerif_aboutus_feature3_title\";s:10:\"Compromiso\";s:27:\"zerif_aboutus_feature3_text\";s:227:\"Llevar nuestros modelos de trabajo al máximo de lugares posibles, para que todo el mundo pueda disfrutar de la moda y el mejor diseño y velar por la calidad de nuestras prendas y el servicio que ofrecemos a nuestros clientes.\";s:25:\"zerif_aboutus_feature3_nr\";i:100;s:28:\"zerif_aboutus_feature4_title\";s:0:\"\";s:25:\"zerif_aboutus_feature4_nr\";i:0;}', 'yes'),
(502, 'widget_ctup-ads-widget', 'a:9:{i:1;a:4:{s:5:\"title\";s:15:\"PARALLAX EFFECT\";s:4:\"text\";s:163:\"Create memorable pages with smooth parallax effects that everyone loves. Also, use our lightweight content slider offering you smooth and great-looking animations.\";s:4:\"link\";s:1:\"#\";s:9:\"image_uri\";s:82:\"http://wazisocks.com:8080/wzstore/wp-content/themes/zerif-lite/images/parallax.png\";}i:2;a:4:{s:5:\"title\";s:11:\"WOOCOMMERCE\";s:4:\"text\";s:166:\"Build a front page for your WooCommerce store in a matter of minutes. The neat and clean presentation will help your sales and make your store accessible to everyone.\";s:4:\"link\";s:1:\"#\";s:9:\"image_uri\";s:77:\"http://wazisocks.com:8080/wzstore/wp-content/themes/zerif-lite/images/woo.png\";}i:3;a:4:{s:5:\"title\";s:21:\"CUSTOM CONTENT BLOCKS\";s:4:\"text\";s:164:\"Showcase your team, products, clients, about info, testimonials, latest posts from the blog, contact form, additional calls to action. Everything translation ready.\";s:4:\"link\";s:1:\"#\";s:9:\"image_uri\";s:77:\"http://wazisocks.com:8080/wzstore/wp-content/themes/zerif-lite/images/ccc.png\";}i:4;a:4:{s:5:\"title\";s:24:\"GO PRO FOR MORE FEATURES\";s:4:\"text\";s:186:\"Get new content blocks: pricing table, Google Maps, and more. Change the sections order, display each block exactly where you need it, customize the blocks with whatever colors you wish.\";s:4:\"link\";s:1:\"#\";s:9:\"image_uri\";s:81:\"http://wazisocks.com:8080/wzstore/wp-content/themes/zerif-lite/images/ti-logo.png\";}s:12:\"_multiwidget\";i:1;i:6;a:6:{s:4:\"text\";s:0:\"\";s:5:\"title\";s:3:\"UNI\";s:4:\"link\";s:0:\"\";s:9:\"image_uri\";s:74:\"http://wazisocks.com:8080/wzstore/wp-content/uploads/2019/11/instagram.png\";s:15:\"custom_media_id\";s:2:\"40\";s:19:\"image_in_customizer\";s:74:\"http://wazisocks.com:8080/wzstore/wp-content/uploads/2019/11/instagram.png\";}i:7;a:6:{s:4:\"text\";s:0:\"\";s:5:\"title\";s:8:\"Facebook\";s:4:\"link\";s:52:\"https://www.facebook