(2988, 'wpforms_notifications', 'a:4:{s:6:\"update\";i:1669596085;s:4:\"feed\";a:0:{}s:6:\"events\";a:6:{s:15:\"welcome-message\";a:6:{s:2:\"id\";s:15:\"welcome-message\";s:5:\"title\";s:23:\"¡Bienvenido a WPForms!\";s:7:\"content\";s:250:\"Te agradecemos que hayas elegido WPForms para tu sitio web Ahora que has instalado el plugin, estás a menos de 5 minutos de publicar tu primer formulario. Para facilitarte las cosas, ¡tenemos más de 500 plantillas de formularios para que empieces!\";s:4:\"btns\";a:2:{s:4:\"main\";a:2:{s:3:\"url\";s:69:\"http://localhost:8080/wzstore/wp-admin/admin.php?page=wpforms-builder\";s:4:\"text\";s:19:\"Empezar a construir\";}s:3:\"alt\";a:2:{s:3:\"url\";s:163:\"https://wpforms.com/docs/creating-first-form/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Welcome%20Read%20the%20Guide\";s:4:\"text\";s:12:\"Lee la guía\";}}s:4:\"type\";a:7:{i:0;s:4:\"lite\";i:1;s:5:\"basic\";i:2;s:4:\"plus\";i:3;s:3:\"pro\";i:4;s:6:\"agency\";i:5;s:5:\"elite\";i:6;s:8:\"ultimate\";}s:5:\"start\";s:19:\"2022-11-26 22:55:00\";}s:15:\"join-vip-circle\";a:5:{s:2:\"id\";s:15:\"join-vip-circle\";s:5:\"title\";s:37:\"¿Quieres ser un VIP? ¡Únete ahora!\";s:7:\"content\";s:394:\"Dirigir un sitio de WordPress puede ser un reto. ¡Pero la ayuda está a la vuelta de la esquina! ¡Nuestro grupo de Facebook contiene toneladas de consejos y ayuda para que tu negocio crezca! Al unirte a nuestro Círculo VIP, obtendrás acceso instantáneo a consejos, trucos y respuestas de una comunidad de fieles usuarios de WPForms. ¡Lo mejor de todo es que la afiliación es 100% gratis!\";s:4:\"btns\";a:1:{s:4:\"main\";a:2:{s:3:\"url\";s:43:\"https://www.facebook.com/groups/wpformsvip/\";s:4:\"text\";s:12:\"Únete ahora\";}}s:5:\"start\";s:19:\"2022-12-26 22:55:00\";}s:14:\"survey-reports\";a:5:{s:2:\"id\";s:14:\"survey-reports\";s:5:\"title\";s:54:\"¿Quieres saber lo que realmente piensan tus clientes?\";s:7:\"content\";s:416:\"No hay nada mejor que los comentarios reales de tus clientes y visitantes. Por eso muchas pequeñas empresas adoran nuestro impresionante complemento de Encuestas y Sondeos. Desbloquea al instante los informes completos de las encuestas directamente en tu panel de control de WordPress. Y no lo olvides: crear una encuesta es fácil con nuestras plantillas prediseñadas, ¡así que podrás empezar en pocos minutos!\";s:4:\"btns\";a:2:{s:4:\"main\";a:1:{s:7:\"license\";a:5:{s:4:\"lite\";a:2:{s:3:\"url\";s:161:\"https://wpforms.com/lite-upgrade/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Surveys%20and%20Polls%20Upgrade%20Lite\";s:4:\"text\";s:16:\"Actualizar ahora\";}s:5:\"basic\";a:2:{s:3:\"url\";s:166:\"https://wpforms.com/account/licenses/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Surveys%20and%20Polls%20Upgrade%20Basic\";s:4:\"text\";s:16:\"Actualizar ahora\";}s:4:\"plus\";a:2:{s:3:\"url\";s:166:\"https://wpforms.com/account/licenses/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Surveys%20and%20Polls%20Upgrade%20Basic\";s:4:\"text\";s:16:\"Actualizar ahora\";}s:3:\"pro\";a:2:{s:3:\"url\";s:68:\"http://localhost:8080/wzstore/wp-admin/admin.php?page=wpforms-addons\";s:4:\"text\";s:14:\"Instalar ahora\";}s:5:\"elite\";a:2:{s:3:\"url\";s:68:\"http://localhost:8080/wzstore/wp-admin/admin.php?page=wpforms-addons\";s:4:\"text\";s:14:\"Instalar ahora\";}}}s:3:\"alt\";a:2:{s:3:\"url\";s:202:\"https://wpforms.com/docs/how-to-install-and-use-the-surveys-and-polls-addon/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Surveys%20and%20Polls%20Learn%20More\";s:4:\"text\";s:12:\"Aprende más\";}}s:5:\"start\";s:19:\"2023-01-10 22:55:00\";}s:16:\"form-abandonment\";a:5:{s:2:\"id\";s:16:\"form-abandonment\";s:5:\"title\";s:57:\"¡Consigue más clientes potenciales con tus formularios!\";s:7:\"content\";s:463:\"¿Tus formularios convierten menos visitantes de lo que esperabas? A menudo, los visitantes abandonan los formularios a mitad de camino. Esto puede impedirte obtener todos los clientes potenciales que mereces captar. Con nuestra extensión de abandono de formularios, puedes capturar entradas parciales, ¡incluso si el visitante no ha pulsado Enviar! A partir de ahí, es fácil hacer un seguimiento de los clientes potenciales y convertirlos en clientes fieles.\";s:4:\"btns\";a:2:{s:4:\"main\";a:1:{s:7:\"license\";a:5:{s:4:\"lite\";a:2:{s:3:\"url\";s:158:\"https://wpforms.com/lite-upgrade/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Form%20Abandonment%20Upgrade%20Lite\";s:4:\"text\";s:16:\"Actualizar ahora\";}s:5:\"basic\";a:2:{s:3:\"url\";s:163:\"https://wpforms.com/account/licenses/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Form%20Abandonment%20Upgrade%20Basic\";s:4:\"text\";s:16:\"Actualizar ahora\";}s:4:\"plus\";a:2:{s:3:\"url\";s:163:\"https://wpforms.com/account/licenses/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Form%20Abandonment%20Upgrade%20Basic\";s:4:\"text\";s:16:\"Actualizar ahora\";}s:3:\"pro\";a:2:{s:3:\"url\";s:68:\"http://localhost:8080/wzstore/wp-admin/admin.php?page=wpforms-addons\";s:4:\"text\";s:14:\"Instalar ahora\";}s:5:\"elite\";a:2:{s:3:\"url\";s:68:\"http://localhost:8080/wzstore/wp-admin/admin.php?page=wpforms-addons\";s:4:\"text\";s:14:\"Instalar ahora\";}}}s:3:\"alt\";a:2:{s:3:\"url\";s:201:\"https://wpforms.com/docs/how-to-install-and-use-form-abandonment-with-wpforms/?utm_source=WordPress&utm_medium=Event%20Notification&utm_campaign=liteplugin&utm_content=Form%20Abandonment%20Learn%20More\";s:4:\"text\";s:12:\"Aprende más\";}}s:5:\"start\";s:19:\"2023-01-25 22:55:00\";}s:21:\"translation-community\";a:5:{s:2:\"id\";s:21:\"translation-community\";s:5:\"title\";s:50:\"¡WPForms necesita tus habilidades de traducción!\";s:7:\"content\";s:293:\