(1254, 1, '2022-11-27 00:42:40', '2022-11-26 23:42:40', '{\n    \"zerif-lite::zerif_aboutus_show\": {\n        \"value\": false,\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-11-26 23:36:32\"\n    },\n    \"zerif-lite::zerif_aboutus_subtitle\": {\n        \"value\": \"ELYSIUM\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-11-26 23:38:52\"\n    },\n    \"zerif-lite::zerif_aboutus_biglefttitle\": {\n        \"value\": \"\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-11-26 23:37:36\"\n    },\n    \"zerif-lite::zerif_aboutus_text\": {\n        \"value\": \"Tenemos como objetivo la comercializaci\\u00f3n de prendas de vestir para hombre y para dama, as\\u00ed como venta de calzado que resalten la belleza de nuestros clientes, todos nuestros productos est\\u00e1n regidos por las \\u00faltimas tendencias de la moda para cada temporada (primavera-verano y oto\\u00f1o-invierno) en ropa, calzado y accesorios.\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-11-26 23:41:45\"\n    },\n    \"zerif-lite::zerif_aboutus_feature1_title\": {\n        \"value\": \"Feedback continuo\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-11-26 23:39:18\"\n    },\n    \"zerif-lite::zerif_aboutus_feature1_nr\": {\n        \"value\": \"100\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-11-26 23:39:18\"\n    },\n    \"zerif-lite::zerif_aboutus_feature1_text\": {\n        \"value\": \"Creemos que la mejor forma de seguir avanzando en nuestro proyecto es escuchar a aquellos que son m\\u00e1s importantes para nosotros, nuestros consumidores. \",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-11-26 23:39:41\"\n    },\n    \"zerif-lite::zerif_aboutus_feature2_title\": {\n        \"value\": \"Responsabilidad\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-11-26 23:40:15\"\n    },\n    \"zerif-lite::zerif_aboutus_feature2_text\": {\n        \"value\": \"Con nuestros clientes, haciendo un esfuerzo continuo para llevar las \\u00faltimas innovaciones a nuestras colecciones.\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-11-26 23:40:15\"\n    },\n    \"zerif-lite::zerif_aboutus_feature2_nr\": {\n        \"value\": \"100\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-11-26 23:40:15\"\n    },\n    \"zerif-lite::zerif_aboutus_feature3_title\": {\n        \"value\": \"Compromiso\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-11-26 23:40:45\"\n    },\n    \"zerif-lite::zerif_aboutus_feature3_text\": {\n        \"value\": \"Llevar nuestros modelos de trabajo al m\\u00e1ximo de lugares posibles, para que todo el mundo pueda disfrutar de la moda y el mejor dise\\u00f1o y velar por la calidad de nuestras prendas y el servicio que ofrecemos a nuestros clientes.\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-11-26 23:41:45\"\n    },\n    \"zerif-lite::zerif_aboutus_feature3_nr\": {\n        \"value\": \"100\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-11-26 23:40:45\"\n    },\n    \"zerif-lite::zerif_aboutus_feature4_title\": {\n        \"value\": \"\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-11-26 23:41:45\"\n    },\n    \"zerif-lite::zerif_aboutus_feature4_nr\": {\n        \"value\": \"\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-11-26 23:41:45\"\n    },\n    \"sidebars_widgets[side